(function(celestra){
"use strict";
function collect(it,mapFn){var r=[],i=0;for(let item of it){if(typeof mapFn!=="function"){r.push(item);}else{r.push(mapFn(item,i++));}}return r;}
celestra.collect = collect;
}(celestra));